request.description:
This endpoint allows you to add attributes to a specific project. The HTTP POST request should be sent to {{laravel-host}}/api/projects/2/attributes, with the request body containing an array of attributes, each consisting of a name and value pair. For example:

``` json
{
  "attributes": [
    {
      "name": "start_date",
      "value": "2025-05-10"
    }
  ]
}

 ```

Upon successful execution, the response will include the details of the added attributes.
